def has_unique_letters(word):
    seen = set()

    for letter in word:
        if letter in seen:
            return False
        seen.add(letter)
    return True


def unique_words_set(words):
    unique_words = set()

    for word in words:
        if has_unique_letters(word) == True:
            unique_words.add(word)

    return unique_words


